import { Link } from "react-router-dom";
import { useSelector } from "react-redux/es/hooks/useSelector";


const Cart = () => {

  const {cart} = useSelector((state) => state);

  return (
    <div>
      {
        cart.length > 0 ?
        (<div>
          <div>
            {
              cart.map((item,index) => {
                return <CartItem/>
              })
            }
          </div>
        </div>) :

        (<div>
          <h1>Cart Empty</h1>
          <Link to={"/"} >
          <button>
            Shop Now
          </button>
          </Link>
        </div>)
      }
      
    </div>
  );
};

export default Cart;
